import React, {useState} from "react";

const Image = (props) => {
    // const imgSrc = "./img1.jpg";
    // const imgName = props.item.name;

    return (
        <div>
            <div class="card my-3 rounded">
                <img src={require(props.imagurl)} class="card-img-top"/>
                <div class="card-body">
                    <h5 class="card-title">{props.name}</h5>
                </div>
            </div>
        </div>
    );
}
export default Image;
